import React from 'react'
import './home.css'
import pallo from './pallo.jpg'


function Home() {
  return (

    <div className="Home">
      <imag>
            
        <img src={pallo} className="images" alt="pal"/>

      </imag>
      <note>
        Note :I am a keen software developer
      </note>

    </div>
    );
}
    
export default Home;
